namespace RonSijm.FluidHumidifier.Factories.IoT;

public class SecurityProfileFactory(string resourceName = null, Action<Humidifier.IoT.SecurityProfile> factoryAction = null) : ResourceFactory<Humidifier.IoT.SecurityProfile>(resourceName)
{

    internal List<InnerSecurityProfileMetricToRetainFactory> AdditionalMetricsToRetainV2Factories { get; set; } = [];

    internal List<InnerSecurityProfileBehaviorFactory> BehaviorsFactories { get; set; } = [];

    internal InnerSecurityProfileMetricsExportConfigFactory MetricsExportConfigFactory { get; set; }

    protected override Humidifier.IoT.SecurityProfile Create()
    {
        var securityProfileResult = CreateSecurityProfile();
        factoryAction?.Invoke(securityProfileResult);

        return securityProfileResult;
    }

    private Humidifier.IoT.SecurityProfile CreateSecurityProfile()
    {
        var securityProfileResult = new Humidifier.IoT.SecurityProfile
        {
            GivenName = InputResourceName,
        };

        return securityProfileResult;
    }
    public override void CreateChildren(Humidifier.IoT.SecurityProfile result)
    {
        base.CreateChildren(result);

        result.AdditionalMetricsToRetainV2 = AdditionalMetricsToRetainV2Factories.Any() ? AdditionalMetricsToRetainV2Factories.Select(x => x.Build()).ToList() : null;
        result.Behaviors = BehaviorsFactories.Any() ? BehaviorsFactories.Select(x => x.Build()).ToList() : null;
        result.MetricsExportConfig ??= MetricsExportConfigFactory?.Build();
    }

} // End Of Class

